import React from "react";
import "./Styling/socialMedia.css";
const SocialIcon = props => {
    const {idx,url,icon} = props;
    return(
        <li 
            href={url} 
            target="_blank" 
            rel="noopener noreferrer">
                <div 
                className="socialIcon">
                {icon}
            </div>
        </li>
    );
};

export default SocialIcon;
